import React from  'react';
import ReactDOM from 'react-dom';
import Card from './Card';

ReactDOM.render(
    <>
    <Card sname="Stranger's Things"
        pic="https://www.google.com/url?sa=i&url=https%3A%2F%2Fabout.netflix.com%2Fen%2Fnews%2Fstranger-things-day-2021-our-complete-preview-guide&psig=AOvVaw0WF2Kpt0VLkRWTFve7aai8&ust=1638800888015000&source=images&cd=vfe&ved=0CAgQjRxqFwoTCIDCzZ_vzPQCFQAAAAAdAAAAABAD"></Card>
    <Card sname="Dark"></Card>
    </>,
    document.getElementById("root")
)
